Create a SQL query to calculate the average daily sales for each month in 2022 using the "orders" table.
A: 
SELECT (SELECT AVG(orderDate) FROM orders WHERE orderDate BETWEEN '2022-01-01' AND '2022-12-31') / (SELECT COUNT(*) FROM orders WHERE orderDate BETWEEN '2022-01-01' AND '2022-12-31') * 100 AS avgDailySales;
